import httpClient from "./httpClient";

const login = (email, password) => {
  const parameters = {
    email: email,
    password: password,
  };
  return httpClient.get(`/login`, {
    params: parameters,
  });
};

// export
const httpClients = {
  login,
};
export default httpClients;
